import React, { Component } from 'react';

// third-party
import {
    Link,
    matchPath,
    Redirect,
    Switch,
    BrowserRouter,
    Route,
} from 'react-router-dom';
import { Helmet } from 'react-helmet';

// application
import { SearchLayout } from './SearchLayout';
import QuickSearch from './QuickSearch';
import SearchMenu from './SearchMenu';

// pages
import SearchCriterias from './search-criterias/index';

export default class Search extends Component {
    render() {
        return (
            <div>
                <Helmet>
                    <title>Jedan test</title>
                    <meta name="description" content="test desc" />
                </Helmet>

                <div className="ekat-search">
                    <div className="ekat-search__quick-search">
                        <QuickSearch />
                    </div>
                    <div className="ekat-search__search-menu">
                        <SearchMenu />
                    </div>

                    <div className="ekat-search__body">
                        <BrowserRouter>
                            <SearchLayout>
                                <Switch>

                                    <Route exact path="/search-criterias" component={SearchCriterias} />

                                </Switch>
                            </SearchLayout>
                        </BrowserRouter>
                    </div>
                </div>
            </div>
        );
    }
}

